list(`package:class` = function (train, class, store = sample(seq(n), 1), trace = TRUE) 
{
  n <- length(class)
  bag <- rep(TRUE, n)
  bag[store] <- FALSE
  repeat {
    if (trace) 
      print(seq(n)[!bag])
    if (sum(bag) == 0) 
      break
    res <- knn1(train[!bag, , drop = FALSE], train[bag, , drop = FALSE], class[!bag])
    add <- res != class[bag]
    if (sum(add) == 0) 
      break
    cand <- (seq(n)[bag])[add]
    if (length(cand) > 1) 
      cand <- sample(cand, 1)
