list(`package:class` = function (x, cl, size, prior, k = 5) 
{
  x <- as.matrix(x)
  n <- nrow(x)
  p <- ncol(x)
  if (length(cl) != n) 
    stop("'x' and 'cl' have different lengths")
  g <- as.factor(cl)
  if (any(is.na(x)) || any(is.na(g))) 
    stop("no missing values are allowed")
  counts <- tapply(rep(1, length(g)), g, sum)
  prop <- counts/n
  np <- length(prop)
  if (missing(prior)) 
    prior <- prop
  else if (any(prior < 0) || round(sum(prior), 5) != 1) 
    stop("invalid 'prior'")
  if (length(prior) != np) 
    stop("'prior' is of incorrect length")
  if (missing(size)) 
    size <- min(round(0.4 * np * (np - 1 + p/2), 0), n)
  inside <- knn.cv(x, cl, k) == cl
  selected <- numeric(0)
  for (i in 1:np) {
    set <- seq_along(g)[unclass(g) == i & inside]
    if (length(set) > 1) 
      set <- sample(set, min(length(set), round(size * prior[i])))
    selected <- c(selected, set)
  }
  list(x = x[selected, , drop = FALSE], cl = cl[selected])
}, function (x, cl, size, prior, k = 5) 
{
  x <- as.matrix(x)
  n <- nrow(x)
  p <- ncol(x)
  if (length(cl) != n) 
    stop("'x' and 'cl' have different lengths")
  g <- as.factor(cl)
  if (any(is.na(x)) || any(is.na(g))) 
    stop("no missing values are allowed")
  counts <- tapply(rep(1, length(g)), g, sum)
  prop <- counts/n
  np <- length(prop)
  if (missing(prior)) 
    prior <- prop
  else if (any(prior < 0) || round(sum(prior), 5) != 1) 
    stop("invalid 'prior'")
  if (length(prior) != np) 
    stop("'prior' is of incorrect length")
  if (missing(size)) 
    size <- min(round(0.4 * np * (np - 1 + p/2), 0), n)
  inside <- knn.cv(x, cl, k) == cl
  selected <- numeric(0)
  for (i in 1:np) {
    set <- seq_along(g)[unclass(g) == i & inside]
    if (length(set) > 1) 
      set <- sample(set, min(length(set), round(size * prior[i])))
    selected <- c(selected, set)
  }
  list(x = x[selected, , drop = FALSE], cl = cl[selected])
})
