list(`package:class` = function (x, class, k = 1, V = 3, I = 5, trace = TRUE) 
{
  n1 <- length(class)
  class <- unclass(class)
  index <- seq_len(n1)
  pass <- lpass <- 0
  repeat {
    if (n1 < 5 * V) {
      warning("retained set is now too small to proceed")
      break
    }
    pass <- pass + 1
    sub <- sample(V, length(class), replace = TRUE)
    keep <- logical(length(class))
    for (i in 1:V) {
      train <- sub == i
      test <- sub == (1 + i%%V)
      keep[test] <- (knn(x[train, , drop = FALSE], x[test, , drop = FALSE], class[train], k) == class[test])
    }
    x <- x[keep, , drop = FALSE]
    class <- class[keep]
    index <- index[keep]
    n2 <- length(class)
    if (n2 < n1) 
      lpass <- pass
    if (lpass <= pass - I) 
      break
    n1 <- n2
    if (trace) 
      message(gettextf("pass %s size %d", pass, n2), domain = NA)
  }
  index
}, function (x, class, k = 1, V = 3, I = 5, trace = TRUE) 
{
  n1 <- length(class)
  class <- unclass(class)
  index <- seq_len(n1)
  pass <- lpass <- 0
  repeat {
    if (n1 < 5 * V) {
      warning("retained set is now too small to proceed")
      break
    }
    pass <- pass + 1
    sub <- sample(V, length(class), replace = TRUE)
    keep <- logical(length(class))
    for (i in 1:V) {
      train <- sub == i
      test <- sub == (1 + i%%V)
      keep[test] <- (knn(x[train, , drop = FALSE], x[test, , drop = FALSE], class[train], k) == class[test])
    }
    x <- x[keep, , drop = FALSE]
    class <- class[keep]
    index <- index[keep]
    n2 <- length(class)
    if (n2 < n1) 
      lpass <- pass
    if (lpass <= pass - I) 
      break
    n1 <- n2
    if (trace) 
      message(gettextf("pass %s size %d", pass, n2), domain = NA)
  }
  index
})
