  for (i in sample(ind)) {
    res <- knn1(train[-c(rest, i), , drop = FALSE], train[c(rest, i), , drop = FALSE], class[-c(rest, i)])
    if (all(res == class[c(rest, i)])) 
      rest <- c(rest, i)
  }
  seq(n)[-rest]
