{
  align <- match.arg(align)
  nc <- col_nchar(text, type = type)
  if (!length(text)) 
    return(text)
  if (align == "left") {
    paste0(text, make_space(width - nc))
  }
  else if (align == "center") {
    paste0(make_space(ceiling((width - nc)/2)), text, make_space(floor((width - nc)/2)))
  }
  else {
    paste0(make_space(width - nc), text)
  }
