{
  split <- try(as.character(split), silent = TRUE)
  if (inherits(split, "try-error") || !is.character(split) || length(split) > 1) 
    stop("`split` must be character of length <= 1, or must coerce to that")
  if (!length(split)) 
    split <- ""
  plain <- strip_style(x)
  splits <- re_table(split, plain, ...)
  chunks <- non_matching(splits, plain, empty = TRUE)
  split.r <- rep(split, length.out = length(x))
  chunks <- lapply(seq_along(chunks), function(i) {
    y <- chunks[[i]]
    if (nrow(y) && !nzchar(split.r[[i]]) && !head(y, 1)[, "length"]) {
      y <- y[-1, , drop = FALSE]
    }
    if (nrow(y) && !tail(y, 1)[, "length"]) 
      y[-nrow(y), , drop = FALSE]
    else y
  })
  zero.chunks <- !vapply(chunks, nrow, integer(1))
  res <- vector("list", length(chunks))
  res[zero.chunks] <- list(character(0))
  res[!zero.chunks] <- mapply(chunks[!zero.chunks], x[!zero.chunks], SIMPLIFY = FALSE, FUN = function(tab, xx) col_substring(xx, tab[, "start"], tab[, "end"]))
  res
