    y <- chunks[[i]]
    if (nrow(y) && !nzchar(split.r[[i]]) && !head(y, 1)[, "length"]) {
      y <- y[-1, , drop = FALSE]
    }
    if (nrow(y) && !tail(y, 1)[, "length"]) 
      y[-nrow(y), , drop = FALSE]
    else y
  })
  zero.chunks <- !vapply(chunks, nrow, integer(1))
  res <- vector("list", length(chunks))
  res[zero.chunks] <- list(character(0))
  res[!zero.chunks] <- mapply(chunks[!zero.chunks], x[!zero.chunks], SIMPLIFY = FALSE, FUN = function(tab, xx) col_substring(xx, tab[, "start"], tab[, "end"]))
  res
})
