  if (!is.null(cray_opt_has) && !isTRUE(cray_opt_has)) 
    return(1)
  if (isTRUE(cray_opt_has) && !is.null(cray_opt_num)) {
    return(as.integer(cray_opt_num))
  }
  if (isTRUE(cray_opt_has) && is.null(cray_opt_num)) {
    default <- get_default_number_of_colors()
    return(default %||% 8)
  }
  if (!is.na(Sys.getenv("NO_COLOR", NA))) 
    return(1)
  if (isTRUE(getOption("knitr.in.progress"))) 
    return(1)
  if (stream == "auto" && !no_sink()) 
    return(1)
  orig_stream <- stream
  stream <- get_real_output(stream)
  is_stdout <- is_stderr <- is_std <- FALSE
  std <- "nope"
  if (identical(stream, stdout())) {
    is_stdout <- is_std <- TRUE
    std <- "stdout"
  }
  else if (identical(stream, stderr())) {
    is_stderr <- is_std <- TRUE
    std <- "stderr"
  }
  if (is_stderr && sink.number("message") != 2) 
    return(1)
  if (.Platform$GUI == "AQUA") 
    return(1)
  rstudio <- rstudio$detect()
  rstudio_colors <- c("rstudio_console", "rstudio_console_starting", "rstudio_build_pane", "rstudio_job")
  if (is.na(rstudio$num_colors)) 
    rstudio$num_colors <- 1
  if (rstudio$type %in% rstudio_colors && is_std) {
    return(rstudio$num_colors)
  }
  if (.Platform$GUI == "Rgui") 
    return(1)
  if (os_type() == "windows" && "--ess" %in% commandArgs() && is_emacs_with_color()) {
    default <- get_default_number_of_colors()
    return(default %||% 8)
  }
  if (!isatty(stream)) 
    return(1)
  if (!is_std) 
    return(1)
  if (is.null(clienv$num_colors)) 
    clienv$num_colors <- list()
  clienv$num_colors[[std]] <- clienv$num_colors[[std]] %||% detect_tty_colors()
  clienv$num_colors[[std]]
})
