list(`package:data.table` = function (x, lower, upper, incbounds = TRUE) 
{
  query = setDT(list(x = x))
  subject = setDT(list(l = lower, u = upper))
  ops = if (incbounds) 
    c(4, 2)
  else c(5, 3)
  verbose = isTRUE(getOption("datatable.verbose"))
  if (verbose) {
    last.started.at = proc.time()
    cat("forderv(query) took ... ")
    flush.console()
  }
  if (verbose) {
    cat(timetaken(last.started.at), "\n")
    flush.console()
  }
  ans = bmerge(shallow(subject), query, 1:2, c(1, 1), 0, c(FALSE, TRUE), 0, "all", ops, verbose)
  xo = ans$xo
  options(datatable.verbose = FALSE)
  setDT(ans[c("starts", "lens")], key = c("starts", "lens"))
  options(datatable.verbose = verbose)
  if (verbose) {
    last.started.at = proc.time()
    cat("Generating final logical vector ... ")
    flush.console()
  }
  .Call(Cinrange, idx <- vector("logical", length(x)), xo, ans[["starts"]], ans[["lens"]])
  if (verbose) {
    cat("done in", timetaken(last.started.at), "\n")
    flush.console
  }
  idx
}, function (x, lower, upper, incbounds = TRUE) 
{
  query = setDT(list(x = x))
