  if (length(names(x)) != ncol) 
    stop("x has ", ncol, " columns but its names are length ", length(names(x)))
  stopifnot(isTRUEorFALSE(skip_absent))
  if (missing(new) || missing(old)) {
    if (missing(old)) {
      old = new
      new = NULL
    }
    if (is.function(old)) 
      old = old(names(x))
    if (!is.character(old)) 
      stop("Passed a vector of type '", typeof(old), "'. Needs to be type 'character'.")
    if (length(old) != ncol) 
      stop("Can't assign ", length(old), " names to a ", ncol, " column data.table")
    if (anyNA(names(x))) {
      w = which((names(x) != old) | (Encoding(names(x)) != Encoding(old)) | (is.na(names(x)) & !is.na(old)))
    }
    else {
      w = which(names(x) != old | (Encoding(names(x)) != Encoding(old)))
    }
    if (!length(w)) 
      return(invisible(x))
    new = old[w]
    i = w
  }
  else {
    if (is.function(new)) 
      new = if (is.numeric(old)) 
        new(names(x)[old])
    else new(old)
