    if (anyNA(new)) 
      stop("NA in 'new' at positions ", brackify(which(is.na(new))))
    if (anyDuplicated(old)) 
      stop("Some duplicates exist in 'old': ", brackify(old[duplicated(old)]))
    if (is.numeric(old)) 
      i = old = seq_along(x)[old]
    else if (!is.character(old)) 
      stop("'old' is type ", typeof(old), " but should be integer, double or character")
    if (length(new) != length(old)) 
      stop("'old' is length ", length(old), " but 'new' is length ", length(new))
    if (anyNA(old)) 
      stop("NA (or out of bounds) in 'old' at positions ", brackify(which(is.na(old))))
