    return(x)
  if (length(cols)) {
    cols = as.list(cols)
    order = rep(1, length(cols))
    for (i in seq_along(cols)) {
      v = as.list(cols[[i]])
      if (length(v) > 1 && v[[1]] == "+") 
        v = v[[-1]]
      else if (length(v) > 1 && v[[1]] == "-") {
        v = v[[-1]]
