list(`package:data.table` = function (x, n = 1, fill = NA, type = c("lag", "lead", "shift"), give.names = FALSE) 
{
  type = match.arg(type)
  stopifnot(is.numeric(n))
  ans = .Call(Cshift, x, as.integer(n), fill, type)
  if (give.names && is.list(ans)) {
    if (is.null(names(x))) {
      xsub = substitute(x)
      if (is.atomic(x) && is.name(xsub)) 
        nx = deparse(xsub, 500)
      else nx = paste0("V", if (is.atomic(x)) 
        1
        else seq_along(x))
    }
    else nx = names(x)
    if (type != "shift") {
      neg = (n < 0)
      if (type == "lead" && length(unique(sign(n))) == 3) 
        neg[n == 0] = TRUE
      if (any(neg)) {
        type = rep(type, length(n))
        type[neg] = if (type[1] == "lead") 
          "lag"
        else "lead"
        n[neg] = -n[neg]
      }
    }
    setattr(ans, "names", paste(rep(nx, each = length(n)), type, n, sep = "_"))
  }
  ans
}, function (x, n = 1, fill = NA, type = c("lag", "lead", "shift"), give.names = FALSE) 
{
  type = match.arg(type)
  stopifnot(is.numeric(n))
  ans = .Call(Cshift, x, as.integer(n), fill, type)
  if (give.names && is.list(ans)) {
    if (is.null(names(x))) {
