list(`package:dplyr` = function (.cols = everything(), .fns = NULL, ..., .names = NULL) 
{
  setup <- across_setup({
    {
      .cols
    }
  }, fns = .fns, names = .names, .caller_env = caller_env(), inline = FALSE)
  vars <- setup$vars
  if (length(vars) == 0) {
    return(new_tibble(list(), nrow = 1))
  }
  fns <- setup$fns
  names <- setup$names
  mask <- peek_mask()
  data <- mask$current_cols(vars)
  if (is.null(fns)) {
    nrow <- length(mask$current_rows())
    data <- new_data_frame(data, n = nrow, class = c("tbl_df", "tbl"))
    if (is.null(names)) {
      return(data)
    }
    else {
      return(set_names(data, names))
    }
  }
  n_cols <- length(data)
  n_fns <- length(fns)
  seq_n_cols <- seq_len(n_cols)
  seq_fns <- seq_len(n_fns)
  k <- 1
  out <- vector("list", n_cols * n_fns)
  old_var <- context_peek_bare("column")
  on.exit(context_poke("column", old_var), add = TRUE)
  withCallingHandlers(for (i in seq_n_cols) {
    var <- vars[[i]]
    col <- data[[i]]
    context_poke("column", var)
    for (j in seq_fns) {
      fn <- fns[[j]]
      out[[k]] <- fn(col, ...)
      k <- k + 1
    }
  }, error = function(cnd) {
    bullets <- c(glue("Problem while computing column `{names[k]}`."))
    abort(bullets, call = call(setup$across_if_fn), parent = cnd)
  })
  size <- vec_size_common(!!!out)
  out <- vec_recycle_common(!!!out, .size = size)
  names(out) <- names
  new_data_frame(out, n = size, class = c("tbl_df", "tbl"))
