list(`package:dplyr` = function (.data, vars, group_vars = character(), .keep_all = FALSE, caller_env = caller_env(2), error_call = caller_env()) 
{
  stopifnot(is_quosures(vars), is.character(group_vars))
  if (length(vars) == 0) {
    return(list(data = .data, vars = seq_along(.data), keep = seq_along(.data)))
  }
  computed_columns <- add_computed_columns(.data, vars, caller_env = caller_env, error_call = error_call)
  .data <- computed_columns$data
