  if (!missing(x)) {
    x <- row_number(x)
  }
  len <- length(x) - sum(is.na(x))
  n <- as.integer(floor(n))
  if (len == 0) {
    rep(NA, length(x))
  }
  else {
    n_larger <- as.integer(len%%n)
    n_smaller <- as.integer(n - n_larger)
    size <- len/n
    larger_size <- as.integer(ceiling(size))
    smaller_size <- as.integer(floor(size))
    larger_threshold <- larger_size * n_larger
    bins <- if_else(x <= larger_threshold, (x + (larger_size - 1))/larger_size, (x + (-larger_threshold + smaller_size - 1))/smaller_size + n_larger)
