list(`package:dplyr` = function (tbl, pkg = NULL, env = NULL) 
{
  lifecycle::deprecate_warn("1.0.0", "src_local()")
  if (!xor(is.null(pkg), is.null(env))) {
    msg <- glue("Exactly one of `pkg` and `env` must be non-NULL, not {(!is.null(pkg)) + (!is.null(env))}.")
    abort(msg)
  }
  if (!is.null(pkg)) {
    env <- getNamespaceInfo(pkg, "lazydata")
    name <- paste0("<package: ", pkg, ">")
  }
  else {
    stopifnot(is.environment(env))
    name <- utils::capture.output(print(env))
  }
  structure(list(tbl_f = match.fun(tbl), name = name, env = env), class = c("src_local", "src"))
}, function (tbl, pkg = NULL, env = NULL) 
{
  lifecycle::deprecate_warn("1.0.0", "src_local()")
  if (!xor(is.null(pkg), is.null(env))) {
    msg <- glue("Exactly one of `pkg` and `env` must be non-NULL, not {(!is.null(pkg)) + (!is.null(env))}.")
    abort(msg)
  }
  if (!is.null(pkg)) {
    env <- getNamespaceInfo(pkg, "lazydata")
    name <- paste0("<package: ", pkg, ">")
  }
  else {
    stopifnot(is.environment(env))
    name <- utils::capture.output(print(env))
  }
  structure(list(tbl_f = match.fun(tbl), name = name, env = env), class = c("src_local", "src"))
})
