  }
  body <- expr({
    if (utils::packageVersion("dplyr") > "0.5.0") {
      dplyr::check_dbplyr()
      !!dbplyr_call
    }
    else {
      !!dplyr_call
    }
  })
  wrapper <- new_function(args, body, caller_env())
  expr(!!obj_sym <- !!get_expr(wrapper))
